import logo from "./logo.svg";
import logoJpg from "./logo.jpg";
import "./App.css";
import { useState } from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import Contact from "./Contact";

const linksList = [
  { id: 1, text: "Home", url: "/" },
  { id: 2, text: "About", url: "/about" },
  { id: 3, text: "Tours", url: "/tours" },
  { id: 4, text: "Services", url: "/services" },
  { id: 5, text: "Blog", url: "/blog" },
  { id: 6, text: "Contact", url: "/contact" },
];

export default function App() {
  const [activeLink, setActiveLink] = useState("Home");
  return (
    <Router>
    <div className="App">
      <Header activeLink={activeLink} setActiveLink={setActiveLink} />
      <Routes>
        <Route path="/contact" element={<Contact />} />
      </Routes>
    </div>
    </Router>
  );
}

function Header({ activeLink, setActiveLink }) {
  return (
    <header className="header">
      <div>
        <Link to= "/">
        <a href="#">
          <img className="logo" src={logoJpg} alt="Logo" />
        </a>
        </Link>
      </div>

      <div className="main-menu">
        <ul className="links-list">
          {linksList.map((link) => (
            <li key={link.id}>
              <Link
                className={activeLink === link.text ? "active" : ""}
                href={link.url}
                onClick={(e) => {
                  e.preventDefault();
                  setActiveLink(link.text);
                }}
              >
                {link.text}
              </Link>
            </li>
          ))}
        </ul>
      </div>
    </header>
  );
}
